import {AppRegistry, Platform} from 'react-native';
import App from './App';
import {name as appName} from './myapp.json';

AppRegistry.registerComponent('sampleapp', () => App);

if (Platform.OS === 'web') {
    AppRegistry.runApplication('sampleapp', {
        rootTag: document.getElementById('root'),
    });
}
